pragma solidity ^0.4.25;



/**

 * @title SafeMath

 * @dev Math operations with safety checks that throw on error

 */

 

library SafeMath {

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {

    if (a == 0) {

      return 0;

    }

    uint256 c = a * b;

    assert(c / a == b);

    return c;

  }



  function div(uint256 a, uint256 b) internal pure returns (uint256) {

    // assert(b > 0); // Solidity automatically throws when dividing by 0

    uint256 c = a / b;

    // assert(a == b * c + a % b); // There is no case in which this doesn't hold

    return c;

  }



  function sub(uint256 a, uint256 b) internal pure returns (uint256) {

    assert(b <= a);

    return a - b;

  }



  function add(uint256 a, uint256 b) internal pure returns (uint256) {

    uint256 c = a + b;

    assert(c >= a);

    return c;

  }

}



/**

 * @title Ownable

 * @dev The Ownable contract has an owner address, and provides basic authorization control

 * functions, this simplifies the implementation of "user permissions".

 */

contract Ownable {

  address public owner;





  event OwnershipTransferred(address indexed previousOwner, address indexed newOwner);





  /**

   * @dev The Ownable constructor sets the original `owner` of the contract to the sender

   * account.

   */

  constructor() public {

    owner = msg.sender;

  }





  /**

   * @dev Throws if called by any account other than the owner.

   */

  modifier onlyOwner() {

    require(msg.sender == owner);

    _;

  }





  /**

   * @dev Allows the current owner to transfer control of the contract to a newOwner.

   * @param newOwner The address to transfer ownership to.

   */

  function transferOwnership(address newOwner) public onlyOwner {

    require(newOwner != address(0));

    emit OwnershipTransferred(owner, newOwner);

    owner = newOwner;

  }



}



/**

 * @title Pausable

 * @dev Base contract which allows children to implement an emergency stop mechanism.

 */

contract Pausable is Ownable {

  event Pause();

  event Unpause();



  bool public paused = false;





  /**

   * @dev Modifier to make a function callable only when the contract is not paused.

   */

  modifier whenNotPaused() {

    require(!paused);

    _;

  }



  /**

   * @dev Modifier to make a function callable only when the contract is paused.

   */

  modifier whenPaused() {

    require(paused);

    _;

  }



  /**

   * @dev called by the owner to pause, triggers stopped state

   */

  function pause() onlyOwner whenNotPaused public {

    paused = true;

    emit Pause();

  }



  /**

   * @dev called by the owner to unpause, returns to normal state

   */

  function unpause() onlyOwner whenPaused public {

    paused = false;

    emit Unpause();

  }

}





/**

 * @title ERC223Interface

 * @dev Simpler version of ERC223 interface

 * @dev see https://github.com/ethereum/EIPs/issues/223

 */



contract ERC223Interface {

    uint public totalSupply;

    function balanceOf(address who) public constant returns (uint);

    function transfer(address to, uint value) public;

    function transfer(address to, uint value, bytes data) public;

    event Transfer(address indexed from, address indexed to, uint value, bytes data);

}



/**

 * @title Contract that will work with ERC223 tokens.

 */

 

contract ERC223ReceivingContract { 

/**

 * @dev Standard ERC223 function that will handle incoming token transfers.

 *

 * @param _from  Token sender address.

 * @param _value Amount of tokens.

 * @param _data  Transaction metadata.

 */

    function tokenFallback(address _from, uint _value, bytes _data) public;

}



/**

 * @title Reference implementation of the ERC223 standard token.

 */

 

contract ERC223Token is ERC223Interface, Pausable  {

    using SafeMath for uint;



    mapping(address => uint) balances; // List of user balances.

    

    /**

     * @dev Transfer the specified amount of tokens to the specified address.

     *      Invokes the `tokenFallback` function if the recipient is a contract.

     *      The token transfer fails if the recipient is a contract

     *      but does not implement the `tokenFallback` function

     *      or the fallback function to receive funds.

     *

     * @param _to    Receiver address.

     * @param _value Amount of tokens that will be transferred.

     * @param _data  Transaction metadata.

     */

     

    function transfer(address _to, uint _value, bytes _data) public whenNotPaused {

        // Standard function transfer similar to ERC20 transfer with no _data .

        // Added due to backwards compatibility reasons .

        uint codeLength;



        assembly {

            // Retrieve the size of the code on target address, this needs assembly .

            codeLength := extcodesize(_to)

        }



        balances[msg.sender] = balances[msg.sender].sub(_value);

        balances[_to] = balances[_to].add(_value);

        if(codeLength>0) {

            ERC223ReceivingContract receiver = ERC223ReceivingContract(_to);

            receiver.tokenFallback(msg.sender, _value, _data);

        }

        emit Transfer(msg.sender, _to, _value, _data);

    }

    

    /**

     * @dev Transfer the specified amount of tokens to the specified address.

     *      This function works the same with the previous one

     *      but doesn't contain `_data` param.

     *      Added due to backwards compatibility reasons.

     *

     * @param _to    Receiver address.

     * @param _value Amount of tokens that will be transferred.

     */

    function transfer(address _to, uint _value) public whenNotPaused {

        uint codeLength;

        bytes memory empty;



        assembly {

            // Retrieve the size of the code on target address, this needs assembly .

            codeLength := extcodesize(_to)

        }



        balances[msg.sender] = balances[msg.sender].sub(_value);

        balances[_to] = balances[_to].add(_value);

        if(codeLength>0) {

            ERC223ReceivingContract receiver = ERC223ReceivingContract(_to);

            receiver.tokenFallback(msg.sender, _value, empty);

        }

        emit Transfer(msg.sender, _to, _value, empty);

    }



    

    /**

     * @dev Returns balance of the `_owner`.

     *

     * @param _owner   The address whose balance will be returned.

     * @return balance Balance of the `_owner`.

     */

    function balanceOf(address _owner) public whenNotPaused constant returns (uint balance)  {

        return balances[_owner];

    }

}





contract ZetTokenMint is ERC223Token {

    

    string public constant name = "ZETCAB";   // Set the name for display purposes

    string public constant symbol = "PZE";  // Set the symbol for display purposes

    uint256 public constant decimals = 18;  // 18 decimals is the strongly suggested default, avoid changing it

    uint256 public constant INITIAL_SUPPLY = 25000000000 * (10 ** uint256(decimals));    // Set the initial supply

    uint256 public totalSupply = INITIAL_SUPPLY;    // Set the total supply

       	

    address internal ZETCABOwner = 0xeA746e7A51173d6Ce404A107ab4C655d8C80716c;  // Set a ZETCABOwner's address



     /**

     * @dev The log is output when the contract is distributed.

     */

    

    constructor() public {

       

        balances[ZETCABOwner] = totalSupply;

        

    }

    

}

